import styled from 'styled-components';

const CollectionItemStyles = styled.section`
  padding: 3rem;
`;

const CollectionItemTitleStyles = styled.h4`
  text-transform: uppercase;
  color: lightblue;
  align-items: center;
`;

export { CollectionItemStyles, CollectionItemTitleStyles };
